// SPDX-License-Identifier: UNLICENSED

pragma solidity ^0.8.0;

import "./interfaces/ISyndicateClosedEndFundStoreV0.sol";
import "./SyndicateOwnerLogic.sol";

/// @author Syndicate Inc.
/// @notice Core module for syndicate data
contract SyndicateClosedEndFundStoreV0 is
    ISyndicateClosedEndFundStoreV0,
    SyndicateOwnerLogic
{
    /// @notice Used to initialize the SyndicateClosedEndFundStoreV0 contract.
    constructor(address owner) SyndicateOwnerLogic(owner) {}

    /// Tracks the logic contracts that have write-access to this data contract.
    /// These addresses should be able to access the setter functions.
    mapping(address => bool) public logicContractAllowed;

    /// @notice The owner adds a new logic contract.
    event LogicContractAdded(address indexed logicContractAddress);

    /// @notice The owner removes a logic contract.
    event LogicContractRemoved(address indexed logicContractAddress);

    /// Modifiers---------------------------------------------------------------

    /// @notice Only proceed if msg.sender is a logic contract that is allowed
    /// to call this data contract.
    modifier onlyLogicContractAllowed() {
        _isLogicContractAllowed();
        _;
    }

    function _isLogicContractAllowed() internal view {
        require(logicContractAllowed[msg.sender], "INVALID_LOGIC_CONTRACT");
    }

    /// Owner functions---------------------------------------------------------

    /// @notice Used by contract owner to grant write access to logic
    /// contracts.
    function addLogicContractsAllowed(address[] calldata logicContractAddresses)
        public
        onlyOwner
    {
        for (uint256 i = 0; i < logicContractAddresses.length; i++) {
            logicContractAllowed[logicContractAddresses[i]] = true;

            emit LogicContractAdded(logicContractAddresses[i]);
        }
    }

    /// @notice Used by contract owner to remove write access to logic
    /// contracts.
    function removeLogicContractsAllowed(
        address[] calldata logicContractAddresses
    ) public onlyOwner {
        for (uint256 i = 0; i < logicContractAddresses.length; i++) {
            logicContractAllowed[logicContractAddresses[i]] = false;

            emit LogicContractRemoved(logicContractAddresses[i]);
        }
    }

    // Contract data------------------------------------------------------------

    // Maps address => true if the wallet at that address is currently managing
    // a Syndicate. Manager wallets are required to be unique to prevent
    // commingling of assets between Syndicates and to ensure that transparency
    // is provided to the members.
    mapping(address => bool) public override isManager;
    // Maps the address of the Syndicate => the wallet address to which
    // deposited funds are sent
    mapping(address => address) public override managerCurrent;
    // Maps the address of the Syndicate => the wallet address nominated as a
    // pending manager, i.e. future manager, of the Syndicate.
    mapping(address => address) public override managerPending;
    // Maps the address of the Syndicate => the wallet address to which the
    // manager's profits will be sent. The manager fee address must be
    // different from the manager's address in order to avoid commingling the
    // Syndicate's assets with its manager's fees.
    mapping(address => address) public override managerFeeAddress;
    // Maps the address of the Syndicate => the fee received when the
    // manager calls `managerAssessManagementFee`. In the future, this will be
    // automatically assessed yearly. The fee amount must be entered in basis
    // points: for example, a management fee of 2% per year would be passed in
    // as 200 basis points because the fees are adjusted by
    // `BASIS_POINTS_DENOMINATOR`, which is set to 10000.
    mapping(address => uint256) public override managerManagementFeeBasisPoints;
    // Maps the address of the Syndicate => the percentage of the Syndicate's
    // distributions that will be allocated to the manager. The fee amount must
    // be entered in basis points: for example, a distribution share of 20% of all
    // distributions would be passed in as 2000 basis points.
    mapping(address => uint256)
        public
        override managerDistributionShareBasisPoints;
    // Maps the address of the Syndicate => the percentage of the Syndicate's
    // distributions that will be allocated to Syndicate Inc. The minimum
    // distribution share is 0.50%, or 50 basis points.
    mapping(address => uint256)
        public
        override syndicateDistributionShareBasisPoints;
    // Maps the address of the Syndicate => the maximum number of members that
    // can make deposits
    mapping(address => uint256) public override numMembersMax;
    // Maps the address of the Syndicate => the number of members with nonzero
    // deposits. For accurate calculation of each member's profit share, this
    // value should NEVER be modified after the Syndicate is closed.
    mapping(address => uint256) public override numMembersCurrent;
    // Maps the address of the Syndicate => the address of the ERC20 contract
    // tracking deposits to the Syndicate. A stablecoin is recommended since
    // this is used to calculate ownership, and fluctations in value can affect
    // these ownership calculations.
    mapping(address => address) public override depositERC20Address;
    // Maps the address of the Syndicate => the minimum amount (of the deposit
    // ERC20) that a single address can deposit.
    mapping(address => uint256) public override depositMemberMin;
    // Maps the address of the Syndicate => the maximum amount (of the deposit
    // ERC20) that a single address can deposit. The manager might restrict the
    // amount that each wallet can deposit into the fund to ensure that
    // ownership is distributed among many people. In the future, we can
    // consider having a mapping that allows you to set per-user deposit
    // thresholds but this is better saved for the asset management contract.
    mapping(address => uint256) public override depositMemberMax;
    // Maps the address of the Syndicate => the maximum amount that can be
    // deposited to the Syndicate overall, e.g. an investment target.
    mapping(address => uint256) public override depositTotalMax;
    // Maps the address of the Syndicate => the amount deposited to the
    // Syndicate in total, from all members. For accurate calculation of each
    // member's ownership stake, this value should NEVER be modified after the
    // Syndicate is closed.
    mapping(address => uint256) public override depositTotal;
    // Maps the address of the Syndicate => a member's wallet address => the
    // amount that they have deposited to the Syndicate. For accurate
    // calculation of the member's profit share, this value should NEVER be
    // modified after the Syndicate is closed.
    mapping(address => mapping(address => uint256))
        public
        override depositMember;
    // Maps the address of the Syndicate => the address of an ERC20 contract =>
    // true if the manager has set a distribution for that ERC20 token, false
    // otherwise.
    mapping(address => mapping(address => bool))
        public
        override distributionERC20Addresses;
    // Maps the address of the Syndicate => the address of an ERC20 contract
    // =>  the amount of the specified ERC20 token that have been set for
    // distribution (in total for all members).
    mapping(address => mapping(address => uint256))
        public
        override distributionTotal;
    // Maps the address of the Syndicate => the address of a distribution ERC20
    // => the amount of the specified ERC20 token that have already been
    // claimed as distributions by ALL members.
    mapping(address => mapping(address => uint256))
        public
        override distributionClaimedTotal;
    // Maps the address of the Syndicate => the address of a distribution ERC20
    // => a member's wallet address => the amount of the specified ERC20 token
    // that the member has already claimed as a distribution.
    mapping(address => mapping(address => mapping(address => uint256)))
        public
        override distributionClaimedMember;
    // Maps the address of the Syndicate => the date the Syndicate was created
    // in in UNIX time. This is also available in the events but the events are
    // tougher to access on chain. This creation date should be relied upon as
    // the source of truth, not the timestamp for the `createdSyndicate`
    // event.
    mapping(address => uint256) public override dateCreated;
    // Maps the address of the Syndicate => the date (in the future) at which
    // the Syndicate is scheduled to close, or the date (in the past) at which
    // the Syndicate actually stopped receiving deposits. This date can be used
    // for calculating management fees.
    mapping(address => uint256) public override dateClose;
    // Maps the address of the Syndicate => true if the Syndicate's deposits
    // have not been finalized by the manager, false otherwise.
    mapping(address => bool) public override open;
    // Maps the address of the Syndicate => true if a Syndicate's members are
    // allowed to claim distributions.
    mapping(address => bool) public override distributing;
    // Maps the address of the Syndicate => true if the manager can adjust
    // deposit and distribution amounts after initalization. Can only be set on
    // Syndicate creation and cannot be changed after that point.
    mapping(address => bool) public override modifiable;
    // Maps the address of the Syndicate => true if the Syndicate ONLY accepts
    // deposits from member wallets on the `allowlist`. False if any
    // (accredited) member can deposit.
    mapping(address => bool) public override allowlistEnabled;
    // Maps the address of the Syndicate => a member's wallet address => true
    // if the member is allowed to deposit to the Syndicate, false otherwise
    // (initialized to false at all addresses). ONLY applied when
    // SyndicateValues.allowlistEnabled is true. Due to the trivial ease of
    // creating new addresses, it is ineffective to maintain a list of blocked
    // addresses (blocklist), so we implement an allowlist instead.
    mapping(address => mapping(address => bool)) public override allowlist;
    // Maps the address of the Syndicate => true if a member can initiate a
    // transfer of all or a portion of their deposit to another address before
    // the Syndicate begins distributing. Member-initiated transfers may
    // haveregulatory concerns (e.g. by allowing a transfer to a non-accredited
    // investor), while manager-initiated transfers are safe for
    // internalbookkeeping purposes. A manager's ability to initiate a transfer
    // is determined by `modifiable` and is independent to `transferable`.
    mapping(address => bool) public override transferable;
    // Maps the address of the Syndicate => key => value. A generic mapping for
    // storing arbitrary data.
    mapping(address => mapping(string => string)) public override metadata;
    // Maps the address of the Syndicate => true if the Syndicate cannot be
    // closed (i.e. an open-ended fund). Defaults to false. Note that starting
    // to populate this field will have a number of downstream implications
    // syndicate functionality including creation, closing, and distribution.
    mapping(address => bool) public override notCloseable;

    /// Setters-----------------------------------------------------------------

    function setIsManager(address manager, bool _isManager)
        public
        override
        onlyLogicContractAllowed
    {
        isManager[manager] = _isManager;
    }

    function setManagerCurrent(address syndicateAddress, address managerAddress)
        public
        override
        onlyLogicContractAllowed
    {
        managerCurrent[syndicateAddress] = managerAddress;
    }

    function setManagerPending(address syndicateAddress, address managerAddress)
        public
        override
        onlyLogicContractAllowed
    {
        managerPending[syndicateAddress] = managerAddress;
    }

    function setManagerFeeAddress(address syndicateAddress, address feeAddress)
        public
        override
        onlyLogicContractAllowed
    {
        managerFeeAddress[syndicateAddress] = feeAddress;
    }

    function setManagerManagementFeeBasisPoints(
        address syndicateAddress,
        uint256 feeBasisPoints
    ) public override onlyLogicContractAllowed {
        managerManagementFeeBasisPoints[syndicateAddress] = feeBasisPoints;
    }

    function setManagerDistributionShareBasisPoints(
        address syndicateAddress,
        uint256 performanceFeeBasisPoints
    ) public override onlyLogicContractAllowed {
        managerDistributionShareBasisPoints[
            syndicateAddress
        ] = performanceFeeBasisPoints;
    }

    function setSyndicateDistributionShareBasisPoints(
        address syndicateAddress,
        uint256 distributionShareBasisPoints
    ) public override onlyLogicContractAllowed {
        syndicateDistributionShareBasisPoints[
            syndicateAddress
        ] = distributionShareBasisPoints;
    }

    function setNumMembersMax(address syndicateAddress, uint256 maxMembers)
        public
        override
        onlyLogicContractAllowed
    {
        numMembersMax[syndicateAddress] = maxMembers;
    }

    function setNumMembersCurrent(
        address syndicateAddress,
        uint256 currentMembers
    ) public override onlyLogicContractAllowed {
        numMembersCurrent[syndicateAddress] = currentMembers;
    }

    function setDepositERC20Address(
        address syndicateAddress,
        address depositAddress
    ) public override onlyLogicContractAllowed {
        depositERC20Address[syndicateAddress] = depositAddress;
    }

    function setDepositMemberMin(address syndicateAddress, uint256 minDeposit)
        public
        override
        onlyLogicContractAllowed
    {
        depositMemberMin[syndicateAddress] = minDeposit;
    }

    function setDepositMemberMax(address syndicateAddress, uint256 maxDeposit)
        public
        override
        onlyLogicContractAllowed
    {
        depositMemberMax[syndicateAddress] = maxDeposit;
    }

    function setDepositTotalMax(
        address syndicateAddress,
        uint256 maxDepositTotal
    ) public override onlyLogicContractAllowed {
        depositTotalMax[syndicateAddress] = maxDepositTotal;
    }

    function setDepositTotal(address syndicateAddress, uint256 total)
        public
        override
        onlyLogicContractAllowed
    {
        depositTotal[syndicateAddress] = total;
    }

    function setDepositMember(
        address syndicateAddress,
        address memberAddress,
        uint256 deposit
    ) public override onlyLogicContractAllowed {
        depositMember[syndicateAddress][memberAddress] = deposit;
    }

    function setDistributionERC20Addresses(
        address syndicateAddress,
        address distributionERC20Address,
        bool isSet
    ) public override onlyLogicContractAllowed {
        distributionERC20Addresses[syndicateAddress][
            distributionERC20Address
        ] = isSet;
    }

    function setDistributionTotal(
        address syndicateAddress,
        address distributionERC20Address,
        uint256 total
    ) public override onlyLogicContractAllowed {
        distributionTotal[syndicateAddress][distributionERC20Address] = total;
    }

    function setDistributionClaimedTotal(
        address syndicateAddress,
        address distributionERC20Address,
        uint256 total
    ) public override onlyLogicContractAllowed {
        distributionClaimedTotal[syndicateAddress][
            distributionERC20Address
        ] = total;
    }

    function setDistributionClaimedMember(
        address syndicateAddress,
        address distributionERC20Address,
        address memberAddress,
        uint256 amount
    ) public override onlyLogicContractAllowed {
        distributionClaimedMember[syndicateAddress][distributionERC20Address][
            memberAddress
        ] = amount;
    }

    function setDateCreated(address syndicateAddress, uint256 date)
        public
        override
        onlyLogicContractAllowed
    {
